INSERT INTO `announcement` VALUES (1,'迎接炎炎夏日的挑戰，我們推出全新一代冷氣機系列！不僅能迅速降溫，還擁有智慧節能功能，讓您享受清涼同時節省能源。立即加入我們的夏日清爽大作戰，感受為您量身打造的舒適體驗！','2024-07-17','夏日清爽大作戰！全新冷氣機登場！'),(2,'無論是辦公室還是家中，清新的空氣是健康的基石。我們自豪地推出全新一代空氣清淨機，配備先進的HEPA濾芯和活性碳過濾技術，有效過濾空氣中的微粒子和有害氣體。無論是花粉、塵螨還是異味，我們都能為您營造一個清新健康的空氣環境。','2024-07-17','空氣清新，健康無憂！全新空氣清淨機上市！'),(3,'面對潮濕的天氣和狹小的空間，潮濕問題成為眾多辦公室和家庭的困擾。我們誠摯推出全新一代除濕機，配備強大的抽濕能力和智慧感應控制，有效調節室內濕度，讓您遠離黴菌和霉變，享受清爽乾燥的空氣品質。','2024-07-17','湿度問題一掃而空！全新除濕機震撼登場!'),(4,'照明不僅僅是照亮空間，更是賦予生活色彩的關鍵。我們將在本周舉行全新智慧燈具發佈會，展示最先進的照明解決方案，包括可調光、遠程控制和自動化情境設置等功能。讓每一次照明都成為一場藝術饗宴，點亮您的生活！','2024-07-17','照亮未來，點亮生活！全新智慧燈具發佈會！'),(5,'最新版本的咖啡機增加了自動清潔功能，每天清潔時間為早上6點。','2024-07-17','咖啡機功能更新公告'),(6,'本周五健身房將舉辦「瑜伽舒展」活動，時間為晚上7點至8點。','2024-07-17','健身房本周活動公告');
/*!40000 ALTER TABLE `announcement` ENABLE KEYS */;
